INSERT INTO `dictionary` VALUES ('1cd7df1430544a41b1f8bb3857a99369', 'pet', 'jinmao', '金毛', '5d2df0aaad6e420c8c5a8c6863ca3255', '34aa4d48ad5544629ebd733953cdb9bd', '8368e1bf45ae498fb07aa151669a3827', '22aaa2b38f63469587a637090bb783e1', '金毛寻回犬', '狗', '金毛寻回犬是最常见的家犬之一，它很容易养，有耐心并且对主人要求不多，只要定期运动，饲喂食物和兽医体检就可以了。它属于匀称、有力、活泼的一个犬种，特征是稳固、身体各部位配合合理，腿既不太长也不笨拙，表情友善，个性热情、机警、自信而且不怕生，性格讨人喜欢。金毛犬最早是一种寻回猎犬，大多作为导盲犬与宠物狗。对小孩子或者婴儿十分友善。金毛犬是位列世界犬种智商排行的第四名。', '金毛寻回犬（Golden Retriever）是单猎犬，比较流行的狗的品种。在猎捕野禽的寻回犬中培养出来的，游泳的续航力极佳。', '2021-04-18 22:18:25', 'admin', NULL, NULL);
INSERT INTO `dictionary` VALUES ('52fa286cafde4ae8b19ca5b2f8eb5daa', 'pet', 'keji', '柯基', 'e753f0afff7847cdb00e384653c79874', '0ff3b723a16d46b4a31e9a584e2ee859', '17510b9018c34f18bea7628185a9ad31', '3289e672459243188d527a9ab628c7d2', '威尔士柯基犬', '狗', '威尔士柯基犬为1107年由法兰德斯工人携带过来的犬种，根据其近似狐狸的头部，有人认为本犬与尖嘴犬祖先关系密切。但也有人认为是随着威尔士与瑞典贸易传至威尔士的瑞典短脚长身犬和土著犬交配，产生了柯基犬。威尔士柯基犬名字来自威尔士语“corrci”娇小之犬的意思。本犬有潘布鲁克犬与卡迪肯犬两种变种犬。潘布鲁克犬比卡迪肯犬名气大，本犬虽然体型娇小，却一直深受高阶层人士喜爱。从12世纪的查理一世到女王伊丽莎白二世，威尔士柯基犬一直是英国王室的宠物', '威尔士柯基犬，威尔士柯基犬（welsh corgi pembroke）是一种小型犬，它们的胆子很大，也相当机警，能高度警惕地守护家园，是最受欢迎的小型护卫犬之一', '2021-04-18 22:09:36', 'admin', NULL, NULL);
INSERT INTO `dictionary` VALUES ('a4044640ad0e43b6b6642372d0da5c31', 'pet', 'hashiqi', '哈士奇', '9df4daedb8b34b7fb7d9525f0bfbdd13', 'e7817afb13c14a56a13a35ba11ead46f', 'e6cbf1ae7e5d4a7681468c4fe5e676d0', '9716d86c2f88408e98ff517578a0fff1', '西伯利亚雪橇犬', '狗', '西伯利亚雪撬犬属于中型工作犬。脚步轻快，动作优美，身体紧凑，有着很厚的被毛，耳朵直立，尾如毛刷，显示出北方地区的遗传特征 [1]  。\n西伯利亚雪撬犬是和狼的血统非常近的犬种，所以外形非常的像狼，有着比大多数犬种都要厚的毛发。\n值得一提的是“蓝眼，三火”，蓝眼指的就是眼睛是蓝色的；三火指的是额头上的三道白色痕迹，看起来像三把燃烧的火苗。“蓝眼，三火”曾经一度被不良商家炒作为是哈士奇的标准，其实这与哈士奇犬种CKU标准没有任何关系', '西伯利亚雪橇犬是原始的古老犬种，主要生活在在西伯利亚东北部、格陵兰南部。哈士奇名字是源自其独特的嘶哑叫声 [1]  。哈士奇性格多变，有的极端胆小，也有的极端暴力，进入人类社会和家庭的哈士奇', '2021-04-18 22:16:36', 'admin', NULL, NULL);
